import React from 'react';
import './App.css';
import "./Styles.css";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';
import Bikes from "./components/Bikes.js";
import Scooters from "./components/Scooters.js";
import Vehicles from "./components/Vehicles.js";
import BookingForm from "./components/BookingForm.js";
import HomePage from './components/Homepage';
import About from './components/About';
import Booking from './components/Booking';

function App() {
  return (
    <Router>
      <div>
        {/* The NavBar component can be placed here if you want it to be present on all pages */}
        <NavBar />

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<About />} />
          <Route path="/booking" element={<BookingForm />} />
          {/* Add other routes for Bikes, Scooters, and Vehicles */}
          <Route path="/bikes" element={<Bikes />} />
          <Route path="/scooters" element={<Scooters />} />
          <Route path="/vehicles" element={<Vehicles />} />
          <Route path="/booking" element={<Booking />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
